import React, { Component } from "react";
import { Link, Route } from "react-router-dom";
import CreateBug from "../bugtrack/createbug.component";
import BugList from "../bugtrack/buglist.component";
import EditBug from "../bugtrack/editbug.component";
import Projects from "../projects/projectlist";
import CreateProject from "../projects/createproject";
import EditProject from "../projects/editproject.component";
import UsersList from "../usersProfile/userList.component";
import EditUsers from "../usersProfile/editUsers.component";
import ViewProjectBugs from "../projects/viewProjectBugs";
import "../layout/navbar.css";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";
import PropTypes from "prop-types";
import 'bootstrap/dist/css/bootstrap.min.css';

class Navbar extends Component {

        onLogoutClick = e => {
            e.preventDefault();
            this.props.logoutUser();
        };
        render() {
            return (
               <div>

                    {/*<!-- Sidebar --> */}
                    <div className="bg-light border-right" id="sidebar-wrapper">
                    <Link to="/dashboard" className="navbar-brand">Bug Tracker</Link>
                        <div className="list-group list-group-flush">
                                <Link to="/buglist" className="list-group-item list-group-item-action bg-light">Show Bugs</Link>
                                <Link to="/create" className="list-group-item list-group-item-action bg-light">Create Bugs</Link>             
                                <Link to="/projects" className="list-group-item list-group-item-action bg-light">Show Projects</Link>
                                <Link to="/createProj" className="list-group-item list-group-item-action bg-light">Create projects</Link>
                                <Link to="/usersList" className="list-group-item list-group-item-action bg-light">Show users</Link>
                                <button onClick={this.onLogoutClick}>Logout</button>
                                <Router>


                            <Route path="/buglist" exact component={BugList}/>
                            <Route path="/edit/:id" component={EditBug} />
                            <Route path="/create/" component={CreateBug} />
                            <Route path="/projects" component={Projects}/>
                            <Route path="/editProj/:id" component={EditProject} />
                            <Route path="/createProj" component={CreateProject} />
                            <Route path="/usersList" component={UsersList} />
                            <Route path="/api/users/:id" component={EditUsers} />
                            <Route path="/bugs/:id" component={ViewProjectBugs} />
</Router>
                        </div>


                    </div>
                    {/*<!-- Page Content --> */}
                    </div>
            );
        }
        }

Navbar.propTypes = {
    logoutUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired
    };
    const mapStateToProps = state => ({
            auth: state.auth
    });
    export default connect(
    mapStateToProps,
    { logoutUser }
)(Navbar);
